import React from 'react'
import iziToast from 'izitoast';

function MyForm() {
    
    return (
        <main>
        {/* <div className='container'>    */}
             <form className='row g-3 needs-validation'>
                <di></di>
                <input type='text' name='username' className='input-group-text' placeholder='masukan username' />
                <input type='password' name='passwords' placeholder='masukan password'/>
            </form>
        {/* </div>     */}
    </main>
      
    )
  }

export default MyForm
